INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 0, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 1, 1, "あたしだって\nやるときはやるよ！", 10040, 24001);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 1, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 1, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 10040, 24002);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 2, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 1, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 10040, 24003);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 3, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 2, 2, "やったね！\nこれでようやく\nサボれるよ…", 10040, 24004);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 4, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 1, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 10040, 24005);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 5, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 2, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 10040, 24006);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 6, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 2, 2, "あたしも意外と\nやるもんでしょ？", 10040, 24007);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 7, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 10040, 24008);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 8, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 10040, 24009);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 9, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, 4, "まじめに\nやったんだけどな…\n悔しいな～", 10040, 24010);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 10, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, 4, "やられた…\nねずみって意外と\nてごわいね", 10040, 24011);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 11, 0.0, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 4, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 10040, 24012);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (24, 102601, 12, 1.81, 0.0, "リン", "2030/12/17 14:59:59", 0.0, "2020/04/30 12:00:00", 1, 4, "疲れた…\nけど、次こそは\n守り抜くよ…", 10040, 24013);
